import './css/Sidebar.css'
import Item from './Item.js'

function Sidebar() {
  return (
    <div id="sidebar">
      <div id="title"><p>Dash</p></div>
      <div id="drop">
        <ul>
          <Item active="active" c="fas fa-home" link="#" value="Home"/>
          <Item c="fas fa-trophy" link="#" value="Projects"/>
          <Item c="fas fa-house-damage" link="#" value="Billings"/>
          <Item c="fas fa-user" link="#" value="Team Members"/>
          <Item c="fas fa-chart-line" link="#" value="Stats"/>
          <Item c="fas fa-cog" link="#" value="Settings"/>

        </ul>
        </div>

    </div>
  );
}

export default Sidebar;
